import React, { FC } from 'react';
import NextHead from 'next/head';

interface IMetatagas {
  title?: string;
  description?: string;
  keywords?: string[];
  author?: string;
  favicon?: string;
}

//TODO: remove external place
const METADATA = {
  title: 'Ricardo Rodrigues | Personal Portfolio Ricardo Rodrigues',
  description: 'Personal Portfolio Ricardo Rodrigues',
  keywords: ['Ricardo', 'Rodrigues', 'frontend', 'curriculum', 'portfolio'],
  author: 'Ricardo Rodrigues',
  favicon:
    'data:image/vnd.microsoft.icon;base64,',
};

const Head: FC<IMetatagas> = ({
  title = METADATA.title,
  description = METADATA.description,
  keywords = METADATA.keywords,
  author = METADATA.author,
  favicon = METADATA.favicon
}) => (
  <NextHead>
    <title>{title}</title>
    <meta name="description" content={description} />
    <meta property="og:type" content="website" />
    <meta name="og:title" property="og:title" content={title} />
    <meta
      name="og:description"
      property="og:description"
      content={description}
    />
    <meta name="twitter:card" content="summary" />
    <meta name="twitter:title" content={title} />
    <meta name="twitter:description" content={description} />
    <meta name="twitter:site" content="" />
    <meta name="twitter:creator" content={author} />
    <link rel="icon" type="image/png" href={favicon} />
    <link rel="apple-touch-icon" href={favicon} />
    <meta property="og:image" content="" />
    <meta name="twitter:image" content="" />
    <meta name="keywords" content={keywords.join(`, `)} />
    <link href="https://fonts.googleapis.com/css2?family=PT+Sans+Narrow:wght@400;700&family=Pacifico&display=swap" rel="stylesheet" />

  </NextHead>
);

export default Head;
